import React, { useState, useRef } from "react";
import "./Projetos.css";
import { TextField, Button, ButtonGroup, Snackbar, Alert, Chip, Box } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import Autocomplete from '@mui/lab/Autocomplete';

const Projetos = () => {
    const navigate = useNavigate();
  
    const [state, setState] = useState({
        titulo: '',
        descricao: '',
        prazo: '',
        nome: '',
    });

    const [tags, setTags] = useState([]);
    const tagInputRef = useRef(null);

    const [snackbarOpen, setSnackbarOpen] = useState(false);
    const [snackbarMessage, setSnackbarMessage] = useState('');
    const [snackbarSeverity, setSnackbarSeverity] = useState('success');

    const handleChange = (campo) => (event) => {
        setState({ ...state, [campo]: event.target.value });
    }

    const handleTagChange = (event, newValue) => {
        setTags(newValue);
        if (tagInputRef.current) {
            setTimeout(() => {
                tagInputRef.current.focus();
            }, 100);
        }
    };

    const handleDeleteTag = (tagToDelete) => () => {
        setTags((tags) => tags.filter((tag) => tag !== tagToDelete));
    };
          
    const salvar = async () => {
        // LÃ³gica para salvar
    }
   
    const cancel = () => {
        console.log('cancel');
    }

    const goToStatus = () => {
        navigate("/sessao/createAssociado");
    }

    const goToAnexos = () => {
        navigate("/sessao/createCliente");
    }

    const handleCloseSnackbar = () => {
        setSnackbarOpen(false);
    };

    return (
        <div className="container">
            <div className="row">
                <div className="col-lg-12">
                    <div className="bs-component">
                        <div style={{marginTop: '80px'}}>
                            <ButtonGroup style={{height:'30px'}} variant="contained" aria-label="Basic button group">
                                <Button style={{ backgroundColor: 'grey', fontSize: 10, width: 120 }}>Processos</Button>
                                <Button style={{ backgroundColor: 'white', color: 'grey' , fontSize: 10, width: 120 }} onClick={goToStatus}>Status</Button>
                                <Button style={{ backgroundColor: 'white', color: 'grey' , fontSize: 10, alignItems: 'center', width: 120  }} onClick={goToAnexos}>Anexos</Button>
                            </ButtonGroup>
                            <div style={{width: 1100, height: 470, background: 'white', border: '2px #838383 solid'}}>
                                <div style={{marginTop: '25px', marginLeft: '30px'}}>
                                    <div style={{width: 80, height: 40, color: '#838383', fontSize: 12, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word'}}>TITULO</div>
                                    <TextField
                                        hiddenLabel
                                        id="filled-hidden-label-small"
                                        defaultValue=""
                                        variant="filled"
                                        size="small"
                                        sx={{
                                            marginTop: '-15px',
                                            width: '250px',
                                            '& .MuiInputBase-root': {
                                                height: '32px',
                                                padding: '0 14px',
                                                '& input': {
                                                    height: '20px',
                                                    padding: '0',
                                                    fontSize: '13px',
                                                },
                                            },
                                        }}
                                        value={state.titulo}
                                        onChange={handleChange('titulo')} 
                                    />

                                <div style={{marginTop: '55px'}}>
                                    <div style={{width: 80, height: 40, color: '#838383', fontSize: 12, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word'}}>DESCRIÃÃO</div>
                                    <TextField
                                        hiddenLabel
                                        id="filled-hidden-label-small"
                                        defaultValue=""
                                        variant="filled"
                                        size="small"
                                        multiline
                                        rows={4}
                                        sx={{
                                            marginTop: '-15px',
                                            width: '250px',
                                            '& .MuiInputBase-root': {
                                                height: 'auto',
                                                padding: '0 14px',
                                                '& textarea': {
                                                    height: '20px',
                                                    fontSize: '13px',
                                                    textAlign: "left",
                                                },
                                            },
                                        }}
                                        value={state.descricao}
                                        onChange={handleChange('descricao')} 
                                    />
                                
                                <div style={{marginTop: '55px', marginLeft: '50px'}}>
                                    <div style={{width: 80, height: 40, color: '#838383', fontSize: 12, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word'}}>PRAZO</div>
                                    <TextField
                                        hiddenLabel
                                        id="filled-hidden-label-small"
                                        defaultValue=""
                                        variant="filled"
                                        size="small"
                                        type="date"
                                        sx={{
                                            marginTop: '-15px',
                                            width: '130px',
                                            '& .MuiInputBase-root': {
                                                height: '32px',
                                                padding: '0 14px',
                                                '& input': {
                                                    height: '20px',
                                                    padding: '0',
                                                    fontSize: '13px',
                                                },
                                            },
                                        }}
                                        value={state.prazo}
                                        onChange={handleChange('prazo')} 
                                    />
                                </div>

                                <div style={{marginTop: '-355px', marginLeft: '650px'}}>
                                    <div style={{width: 200, height: 40, color: '#838383', fontSize: 12, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word'}}>REGISTRO DA RECEITA FEDERAL</div>
                                    <TextField
                                        hiddenLabel
                                        id="filled-hidden-label-small"
                                        defaultValue=""
                                        variant="filled"
                                        size="small"
                                        sx={{
                                            marginTop: '-15px',
                                            width: '250px',
                                            '& .MuiInputBase-root': {
                                                height: '32px',
                                                padding: '0 14px',
                                                '& input': {
                                                    height: '20px',
                                                    padding: '0',
                                                    fontSize: '13px',
                                                },
                                            },
                                        }}
                                        value={state.nome}
                                        onChange={handleChange('nome')} 
                                    />
                                    <div style={{marginTop: '55px'}}>
                                        <div style={{width: 200, height: 40, color: '#838383', fontSize: 12, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word'}}>TAGS</div>
                                        <Autocomplete
                                            multiple
                                            freeSolo
                                            options={[]}
                                            value={tags}
                                            onChange={handleTagChange}
                                            renderTags={() => null} // Desabilita a renderizaÃ§Ã£o das tags dentro do campo de entrada
                                            renderInput={(params) => (
                                                <TextField
                                                    {...params}
                                                    inputRef={tagInputRef}
                                                    variant="filled"
                                                    hiddenLabel
                                                    size="small"
                                                    sx={{
                                                        marginTop: '-15px',
                                                        width: '250px',
                                                        '& .MuiInputBase-root': {
                                                            height: '32px',
                                                            padding: '0 14px',
                                                            '& input': {
                                                                height: '20px',
                                                                padding: '0',
                                                                fontSize: '13px',
                                                            },
                                                        },
                                                    }}
                                                />
                                            )}
                                        />
                                        <Box sx={{ display: 'flex', flexWrap: 'wrap', gap: 0.5, marginTop: '8px' }}>
                                            {tags.map((tag, index) => (
                                                <Chip key={index} label={tag} onDelete={handleDeleteTag(tag)} />
                                            ))}
                                        </Box>
                                        </div>
                                        <div style={{marginTop: '88px'}}>
                                        <div style={{width: 200, height: 40, color: '#838383', fontSize: 12, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word'}}>CLIENTE</div>
                                        <TextField
                                        hiddenLabel
                                        id="filled-hidden-label-small"
                                        defaultValue=""
                                        variant="filled"
                                        size="small"
                                        sx={{
                                            marginTop: '-15px',
                                            width: '250px',
                                            '& .MuiInputBase-root': {
                                                height: '32px',
                                                padding: '0 14px',
                                                '& input': {
                                                    height: '20px',
                                                    padding: '0',
                                                    fontSize: '13px',
                                                },
                                            },
                                        }}
                                        value={state.nome}
                                        onChange={handleChange('nome')} 
                                    />
                                    </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div style={{ marginTop: '20px' }}>
                                <Button onClick={salvar} variant="contained" style={{width: 120, height: 40, backgroundColor: 'grey'}}>Salvar</Button>
                                <Button onClick={cancel} variant="contained" style={{width: 120, height: 40, backgroundColor: 'grey', marginLeft: '850px'}}>Cancelar</Button>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
            <Snackbar open={snackbarOpen} autoHideDuration={6000} onClose={handleCloseSnackbar}>
                <Alert onClose={handleCloseSnackbar} severity={snackbarSeverity} sx={{ width: '100%' }}>
                    {snackbarMessage}
                </Alert>
            </Snackbar>
        </div>
    );
}

export default Projetos;
